console.log(token);
console.log(token == true);

export default  PrivateRoute = ({ component: Component, ...rest }) => (
  <Route {...rest} render={(props) => (
    token !== ""
      ? <Component {...props} />
      : <Redirect to='/' />
  )} />
)
